import React, { Component } from 'react';
import './home.css';

class Home extends Component {
  render() {
    return (
      <div>
        <p>Good morning, Eric</p>
        <form>
          <input id="todayWeight"/>
        </form><br/>
      </div>
    );
  }
}

export default Home;
